(491, 8, '[\"\",\"\",\"\",\"\",\"https//:devzonia.com/ptpms/admin/projects/save/8\",\"Projects\",\"update\",\"8\"]', '[{\"project_desc\":\"USPs:\n- Suitable for CBI;\n- Title deed ready;\n- Coastal project - 150 m away from coastline.\"}, {\"project_desc\":\"Lifestyle: the green area at this project constitutes more than half of the entire land plot (3,500 SqM out of 5,000 SqM); Due to being located at the Kartal coast, right by the Sea of Marmara, this project is distinctive for its dazzling unobstructed views of the Princes’ Islands and the sea. Every unit in the project promises a serene home life with this dazzling panoramic view. This project is coming to life on the Coastal Road, famous for its large green parks, flower gardens, biking and walking paths, jogging trails, playgrounds and dining venues. All homes in this project include a spacious and functional balcony facing the sea view. Thanks to the +1,5 concept, when the sliding glass windows are open you’ll have a gorgeous balcony, and when they’re closed you’ll have more living space.\"}]', '2022-04-26 11:18:00', 1),
