(591, 8, '[\"\",\"\",\"\",\"\",\"https//:devzonia.com/ptpms/admin/properties/save/-1\",\"Properties\",\"save_new\",\"-1\"]', '[{\"language_id\":\"1\",\"category_id\":\"107\",\"property_ref\":\"PTFS6264\",\"property_title\":\"Sentez Merter\",\"property_desc\":\"Location Name       : Güngören\nCompletion date    : September / 2022\nDeveloper               : Sentez Inşaat\nPayment Plan        :  Cash  \n                                \n                                50% down payment + 12 months instalments\n                                  \nAvailable types      : Commercial Units\n\nA-1 unit type with sizes varying from 24 - 64 SqM and the prices start from 251.000 USD\nA-2 unit type of 35 SqM and the prices starting from 322.500 USD\nB-1 unit type of 20 - 84 SqM size and the prices starting from 166.000 USD\nB-2 unit type of 23 - 56 SqM size and the prices starting from 270.000 USD\nB-3 unit type of 24 - 47 SqM size and the prices starting from 221.000 USD\nC unit type of 48 - 366 SqM size and the prices starting from 942.586 USD\nD unit type of 22 - 37 SqM size and the price starting from 350.000 USD\n\n\nCommission: 10% included\n\nThe agreement isn’t signed and stamped because they operate on Protocol per sale basis. So each time a sale is about to be made a Protocol will be drawn.\n\nGoogle maps / Yandex Location: https://goo.gl/maps/Z7GLrRQqoTFESJsU7 \n\nContact person, Soroosh Jaffary: 0 549 557 33 00 \n\nProject Drive link: https://drive.google.com/drive/folders/1j00bfO3BMoOT8ikNYg3X5amlUHqHKfos \n\nUSPs: \nSuitable for CBI;\nTitle Deed ready;\nPerfect for investment for retail shop owners;\nSurrounded by textile factories and workshops;\nCreated with the concept of the shopping centre in mind;\nConsists of 237 shops and 3 kiosks throughout the 7 floors excluding the parking floor;\nCargo services will be provided on site to ease the logistics for the commercial unit owners (not to mention the high ceilings, big corridors, the loading ramps and the industrial elevators all built with the convenience of the shop owners in mind).\n\nImportant to note from the sales office for the Advisers (optional reference):\nWhy Should you invest in Sentez Merter?\n1) Rental Guarantee under Dollars for 3 years and high rental yield\n2) chances for startup business in clothes and ready-wear\n3) high appreciation after delivery and high return on investment\n4) rental income tax advantage (the tenant pays the most of it)\n5) VAT exemption for Foreign investors\n6) easy Exit Strategy for resale since your potential customers will be local turkish textile business owners\",\"id\":-1}]', '2022-05-09 14:08:15', 1),
