(2039, 14, '[\"\",\"\",\"\",\"\",\"https//:devzonia.com/ptpms/admin/projects/save/51\",\"Projects\",\"update\",\"51\"]', '[{\"project_desc\":\"\"}, {\"project_desc\":\"<p>Nidapark &Ccedil;engelk&ouml;y offers you the advantage of a location where you can easily reach every point of Istanbul, as it is located in the very center of &Ccedil;engelk&ouml;y, right in the middle of two bridges. The project, which is 35 minutes from Sabiha G&ouml;k&ccedil;en Airport, 15 minutes from 15 July Martyrs Bridge, 13 minutes from Fatih Sultan Mehmet Bridge, and 5 minutes from &Ccedil;engelk&ouml;y Square, is also very close to sea transportation. It is 20 minutes from &Ccedil;ubuklu İstinye ferry port and 3 kilometers from Beylerbeyi Pier. It also offers different sea transportation alternatives with its proximity to &Uuml;sk&uuml;dar, Kandilli, and &Ccedil;ubuklu &ndash; İstinye (Car ferry) piers.<br />\nNidapark &Ccedil;engelk&ouml;y, where you can experience the neighborhood culture, offers you a privileged life with its low-rise horizontal architecture, large garden, and terrace usage areas. The project includes 12 blocks and 207 residences. The flat types in the project start with 2+1 and go up to 5.5+1 duplex. This diversity and richness of alternatives bring you freedom and ease of choice.<br />\nApartments with 2+1, 3+1, 3,5+1, 3,5+1 D, 4+1, 4,5+1, 4,5+1D and 5.5+1D options range from 135 to 410 square meters. provides the possibility of use. In the plans with a small number of apartments on each floor, the smart home concept apartments have maximum efficiency, large living room windows, spacious facades, and comfortable living spaces.<br />\nNidapark &Ccedil;engelk&ouml;y social facilities are planned for you to spend a fun and safe time with your loved ones. It has been carefully designed to help you take your life pleasing to the next level with its walking paths, ornamental pools, indoor-outdoor pool and sun terrace, large and featured children&#39;s playgrounds, and green landscaping areas.</p>\n\"}]', '2022-09-19 09:09:43', 1),
