(2097, 14, '[\"\",\"\",\"\",\"\",\"https//:devzonia.com/ptpms/admin/projects/save/52\",\"Projects\",\"update\",\"52\"]', '[{\"project_desc\":\"\",\"param_space\":30600}, {\"project_desc\":\"<p>It will consist of 6 blocks in the first stage and 3 blocks in the second stage and was built in nature and surrounded by green; Benesta Acıbadem, designed by enriching with a house and a park, consists of 563 residences. Benesta Acıbadem breathes life with balconies, gardens, or terraces in each flat, starting from 10 m2 and reaching up to 100 m2. The project ranges from 2+1 to 6+1; simplex brings together different living options with its garden duplex, roof duplex, and terrace garden apartments.<br />\nBenesta Acıbadem, which will create a new address on the Anatolian Side at the meeting point of roads and directions, is being built in a unique location. Benesta Acıbadem is located next to the European Side, in a location adjacent to the comprehensive health institutions, deep-rooted educational institutions, and colorful social and commercial life of both sides. The project, which is within walking distance of Akasya AVM, is located on the colorful addresses of the Anatolian Side such as Bağdat Caddesi, Kadık&ouml;y, and Kalamış Marina; With its locations in Zincirlikuyu, Beşiktaş, Levent, Mecidiyek&ouml;y, Taksim, and Karak&ouml;y, it draws attention with its proximity to the Bosphorus line. In Benesta Acıbadem, where design is guided primarily by green space and landscape planning; Worked with WATG, one of London&#39;s famous landscape architecture offices. After the Benleo Park was designed on an area of ​​15 decares, the project&#39;s concept planning and general site plan&nbsp;were implemented around this plan. Benesta Acıbadem project with its perfectionist approach; was awarded as a five-star project in the mixed-use category by the &ldquo;European Property Awards&rdquo; by the EPA organization and received full marks from authorities around the world.</p>\n\",\"param_space\":\"30622\"}]', '2022-09-19 11:05:26', 1),
