(2128, 14, '[\"\",\"\",\"\",\"\",\"https//:devzonia.com/ptpms/admin/projects/save/53\",\"Projects\",\"update\",\"53\"]', '[{\"project_desc\":\"\"}, {\"project_desc\":\"<p>Mega Garden Park is being built in Zeytinburnu. The houses, which are among the flats for sale in Istanbul, stand out with their design and location. These houses, which have easy access to the central points, aim to please you with the view and the park that surrounds the project.<br />\nMega Garden Park, which is a new housing project in Istanbul, consists of 4 blocks in total. Each block is 11 stories high. The modern-designed blocks contain a total of 528 flats. The project consists of houses of 1+1, 2+1, and 3+1 sizes. Thus, it is possible to find suitable apartments in this living area, from minimal preferences to extended family life. The project, which meets all your needs, will accompany you with its park view. Mega Garden Park, which is one of the new Zeytinburnu residence projects, awaits everyone who is considering investing in Istanbul. Be a part of this project without missing the opportunity<br />\nUSPs:<br />\nSuitable for CBI<br />\nCentrally located, in the heart of Zeytinburnu<br />\nLuxury project with a magnificent view of the Bosphorus<br />\nBoasts full social facilities within a modern suburban vibe of a compound<br />\nIdeal for lifestyle with leisurely activities being located in the same neighborhood<br />\n- an ice skating rink is located only 3 minute&#39;s walk away from the residence.<br />\nProximity<br />\n1 minute to &Ccedil;ırpıcı National Park<br />\n2 minutes to the E5 highway<br />\n3 minutes walking distance to the ice skating rink<br />\n3 minutes to Zeytinburnu metro station<br />\n5 minutes to Marmara Forum shopping center<br />\n5 minutes to Zeytinburnu Promenade<br />\n15 minutes to Sultanahmet Square<br />\n25 minutes to Istanbul Airport.<br />\nSocial facilities&nbsp;<br />\n- A closed swimming pool<br />\n- Gym<br />\n- Sauna<br />\n- Turkish bath<br />\n- Children&#39;s playground.</p>\n\"}]', '2022-09-19 12:26:52', 1),
