(48, NULL, 801, 14, 0, 0, ',807,811,815,816,821,826,827,828,829,830,833,846,852,853,854,864,', 'Renova Evleri', '<p>We Istanbul located in Ataşehir, İstanbul, this is a project that will change your lifestyle because of its design and environmental features. It&rsquo;s also located in İstanbul&rsquo;s heart as a finance center so you will be lucky to live in this flat. The flat has different architectural designs and modern interior design ideas, also very close to every famous area in İstanbul because of the transportation. The flat is near TEM road, Finance City Metro Station, and Sabiha G&ouml;k&ccedil;en airport. Also, you can have educational schools nearby you such as Marmara University. You can find peace and city life together in this project. You can have a home in the city with peaceful features such as living with nature together in your flat&rsquo;s architecture. &nbsp;<br />\nWe Istanbul Location info:<br />\n25 minutes to Sabiha G&ouml;k&ccedil;en Airport<br />\n5 minutes to Marmaray Train Station<br />\n5 minutes to Hospital and Other Institutions<br />\n10 minutes to Ferry Boat and Yacht Marina<br />\n5 minutes to Marmara University<br />\n5 minutes to Metropol Shopping Mall</p>\n', '16667945050.jpg,16667945051.jpg,16667945052.jpg,16667945053.jpg,16667945054.jpg,16667945055.jpg', '', '41.010585,29.185471', 'PTJ48UID14', 'Turkey', 'İstanbul', 'Ümraniye', 'Madenler', 'Kurukaya Sokak', 3500, 855, NULL, 5000, 80, 7, NULL, NULL, '876,886', '97,145', '', '', NULL, '2022-09-16 13:27:10', '2022-09-16 13:27:10', 0, 0, 1),
