(50, NULL, 801, 14, 0, 0, ',807,809,811,815,816,821,824,826,827,828,829,830,832,835,836,837,838,842,844,845,846,848,850,852,853,854,864,865,866,', 'Panorama Çamlıca Evleri', '', '16634120140.jpg,16634120141.jpg,16634120142.jpg,16634120143.jpg,16634120144.jpg,16634120145.jpg', '', '41.01383,29.068559', 'PTJ50UID14', 'Turkey', 'İstanbul', 'Üsküdar', 'Küçük Çamlıca Mh', 'Çamlıca Evleri', NULL, 855, NULL, NULL, 7, 4, 76, NULL, '923,926,876,880,885', '152,500', '', '', NULL, '2022-09-17 10:46:54', '2022-09-17 10:46:54', 0, 0, 1),
(51, NULL, 801, 14, 0, 0, ',807,809,811,815,816,821,823,824,826,827,828,829,830,832,836,837,838,842,846,847,848,850,852,853,854,864,865,866,', 'NidaPark Çengelköy', '<p>Nidapark &Ccedil;engelk&ouml;y offers you the advantage of a location where you can easily reach every point of Istanbul, as it is located in the very center of &Ccedil;engelk&ouml;y, right in the middle of two bridges. The project, which is 35 minutes from Sabiha G&ouml;k&ccedil;en Airport, 15 minutes from 15 July Martyrs Bridge, 13 minutes from Fatih Sultan Mehmet Bridge, and 5 minutes from &Ccedil;engelk&ouml;y Square, is also very close to sea transportation. It is 20 minutes from &Ccedil;ubuklu İstinye ferry port and 3 kilometers from Beylerbeyi Pier. It also offers different sea transportation alternatives with its proximity to &Uuml;sk&uuml;dar, Kandilli, and &Ccedil;ubuklu &ndash; İstinye (Car ferry) piers.<br />\nNidapark &Ccedil;engelk&ouml;y, where you can experience the neighborhood culture, offers you a privileged life with its low-rise horizontal architecture, large garden, and terrace usage areas. The project includes 12 blocks and 207 residences. The flat types in the project start with 2+1 and go up to 5.5+1 duplex. This diversity and richness of alternatives bring you freedom and ease of choice.<br />\nApartments with 2+1, 3+1, 3,5+1, 3,5+1 D, 4+1, 4,5+1, 4,5+1D and 5.5+1D options range from 135 to 410 square meters. provides the possibility of use. In the plans with a small number of apartments on each floor, the smart home concept apartments have maximum efficiency, large living room windows, spacious facades, and comfortable living spaces.<br />\nNidapark &Ccedil;engelk&ouml;y social facilities are planned for you to spend a fun and safe time with your loved ones. It has been carefully designed to help you take your life pleasing to the next level with its walking paths, ornamental pools, indoor-outdoor pool and sun terrace, large and featured children&#39;s playgrounds, and green landscaping areas.</p>\n', '16635763130.jpg,16635763131.jpg,16635763132.jpg,16635763133.jpg,16635763134.jpg,16635763135.png', '', '41.056512,29.073019', 'PTJ51UID14', 'Turkey', 'İstanbul', 'Üsküdar', 'Çengelköy', 'Engin Caddesi', 36500, 856, NULL, 207, 12, 4, 207, NULL, '926,876,880', '128,274', '', '', NULL, '2022-09-19 08:22:02', '2022-09-19 08:22:02', 0, 0, 1),
(52, NULL, 801, 14, 0, 0, ',807,809,811,815,816,821,823,824,826,827,828,829,830,832,836,837,838,840,841,842,846,848,850,852,853,854,864,866,', 'Benesta Acibadem', '<p>It will consist of 6 blocks in the first stage and 3 blocks in the second stage and was built in nature and surrounded by green; Benesta Acıbadem, designed by enriching with a house and a park, consists of 563 residences. Benesta Acıbadem breathes life with balconies, gardens, or terraces in each flat, starting from 10 m2 and reaching up to 100 m2. The project ranges from 2+1 to 6+1; simplex brings together different living options with its garden duplex, roof duplex, and terrace garden apartments.<br />\nBenesta Acıbadem, which will create a new address on the Anatolian Side at the meeting point of roads and directions, is being built in a unique location. Benesta Acıbadem is located next to the European Side, in a location adjacent to the comprehensive health institutions, deep-rooted educational institutions, and colorful social and commercial life of both sides. The project, which is within walking distance of Akasya AVM, is located on the colorful addresses of the Anatolian Side such as Bağdat Caddesi, Kadık&ouml;y, and Kalamış Marina; With its locations in Zincirlikuyu, Beşiktaş, Levent, Mecidiyek&ouml;y, Taksim, and Karak&ouml;y, it draws attention with its proximity to the Bosphorus line. In Benesta Acıbadem, where design is guided primarily by green space and landscape planning; Worked with WATG, one of London&#39;s famous landscape architecture offices. After the Benleo Park was designed on an area of ​​15 decares, the project&#39;s concept planning and general site plan&nbsp;were implemented around this plan. Benesta Acıbadem project with its perfectionist approach; was awarded as a five-star project in the mixed-use category by the &ldquo;European Property Awards&rdquo; by the EPA organization and received full marks from authorities around the world.</p>\n', '16635846940.jpg,16635846941.jpg,16635846942.jpg,16635846943.jpg,16635846944.jpg,16635847890.jpg,16635847891.jpg,16635847892.jpg,16635847893.jpg,16635847894.jpg,16635849590.jpg,16635849591.jpg,16635849592.jpg,16635849593.jpg', '', '41.007739,29.060793', 'PTJ52UID14', 'Turkey', 'İstanbul', 'Üsküdar', 'Acıbadem', 'Çeçen Sokağı', 30622, 856, NULL, 563, 9, 15, 563, NULL, '923,926,876', '62,315', '', '', NULL, '2022-09-19 09:21:13', '2022-09-19 09:21:13', 0, 0, 1),
(53, NULL, 801, 14, 0, 0, ',807,809,811,815,816,821,823,824,826,827,828,829,830,832,836,837,838,842,846,847,848,852,853,854,864,865,866,', 'Mega Garden Park', '<p>Mega Garden Park is being built in Zeytinburnu. The houses, which are among the flats for sale in Istanbul, stand out with their design and location. These houses, which have easy access to the central points, aim to please you with the view and the park that surrounds the project.<br />\nMega Garden Park, which is a new housing project in Istanbul, consists of 4 blocks in total. Each block is 11 stories high. The modern-designed blocks contain a total of 528 flats. The project consists of houses of 1+1, 2+1, and 3+1 sizes. Thus, it is possible to find suitable apartments in this living area, from minimal preferences to extended family life. The project, which meets all your needs, will accompany you with its park view. Mega Garden Park, which is one of the new Zeytinburnu residence projects, awaits everyone who is considering investing in Istanbul. Be a part of this project without missing the opportunity<br />\nUSPs:<br />\nSuitable for CBI<br />\nCentrally located, in the heart of Zeytinburnu<br />\nLuxury project with a magnificent view of the Bosphorus<br />\nBoasts full social facilities within a modern suburban vibe of a compound<br />\nIdeal for lifestyle with leisurely activities being located in the same neighborhood<br />\n- an ice skating rink is located only 3 minute&#39;s walk away from the residence.<br />\nProximity<br />\n1 minute to &Ccedil;ırpıcı National Park<br />\n2 minutes to the E5 highway<br />\n3 minutes walking distance to the ice skating rink<br />\n3 minutes to Zeytinburnu metro station<br />\n5 minutes to Marmara Forum shopping center<br />\n5 minutes to Zeytinburnu Promenade<br />\n15 minutes to Sultanahmet Square<br />\n25 minutes to Istanbul Airport.<br />\nSocial facilities&nbsp;<br />\n- A closed swimming pool<br />\n- Gym<br />\n- Sauna<br />\n- Turkish bath<br />\n- Children&#39;s playground.</p>\n', '16635898460.jpg,16635898461.jpg,16635898462.jpg,16635898463.jpg,16635898464.jpg,16635898465.jpg,16635898466.jpg,16635898467.jpg,16635898468.jpg,16635898469.jpg,166358984610.jpg,166358984611.jpg,166358984612.jpg,16635899200.jpg,16635899201.jpg,16635899202.jpg,16635899203.jpg', '', '40.99698,28.893477', 'PTJ53UID14', 'Turkey', 'İstanbul', 'Zeytinburnu', 'Veliefendi', 'Çimen Sokak', NULL, 856, '2025-06-02', 528, 4, 11, 528, NULL, '923,926,876', '46,108', '', '', NULL, '2022-09-19 11:46:59', '2022-09-19 11:46:59', 0, 0, 1),
(54, NULL, 801, 14, 0, 0, ',807,815,816,821,823,824,826,827,828,829,830,831,832,836,846,847,848,850,852,853,854,864,865,866,', 'Hadımköy Loft', '<p>Hadimkoy Loft, being in one of the most valued regions in Istanbul, waits to meet with you! The project is constructed by Karlidag Insaat, on a 3500 square meter field. It is located in Catalca, on the European Side of Istanbul. Karlidag Insaat specializes in urban transformation and land development projects for more than 10 years. The firm offers you projects that make a difference and do not compromise on quality. Being 5 minutes away from Kanal Istanbul, Hadimkoy Loft takes attention by having high investment value. Low-rise and boutique project has 2+1, 3+1,3+2, 4+2 and 6+2 apartment options. It also has duplex apartment types and 54 units in total.<br />\n<br />\nUSPs: 7/24 security<br />\nFacilities include: gym, playground, open parking lot<br />\n-&nbsp;Suitable for investment and citizenship&nbsp;<br />\n- Low entry-level price points for a developing area that will triple in price in 2 years from now&nbsp;<br />\n-&nbsp;Proximity to the New Istanbul Airport<br />\n- 15 minutes away from Istanbul Industrial Zone<br />\n- 15 minutes away&nbsp;Bus station is within walking distance of the project.</p>\n', '16635977060.jpg,16635977061.jpg,16635977062.jpg,16635977063.jpg,16635977064.jpg,16635977065.jpg,16635977066.jpg,16635977067.jpg,16635977068.jpg', '', '41.162201,28.621823', 'PTJ54UID14', 'Turkey', 'İstanbul', 'Arnavutköy', 'Hadımköy', 'Hayrettin Özbek Sokak', 3500, 856, '2022-12-02', 54, 2, 5, 54, NULL, '926,876,878,882,890', '75,250', '', '', NULL, '2022-09-19 14:22:32', '2022-09-19 14:22:32', 0, 0, 1),
